import styles from "./Nav.module.css"
import {Link} from "react-router-dom"
import { useEffect, useState } from "react"


function Nav ({items}){
    const [link, setLink] = useState("/")
    useEffect((item)=> {
        getLink(item)
    })
    function getLink(item){
        setLink(`/${item}`.toLowerCase())
        return link;
    }

    return (
        <ul className={styles.navList}>
            {
                items.map((item, key)=>{
                    return <>
                    <Link key={key} className={styles.navItem} to={useEffect(item)}>{item}</Link>
                    </>
                    //return <li key={key} className={styles.navItem}>{item}</li>
                    //return <li key={key} className={styles.navItem}>{item}</li>
                })
            }
        </ul>
    )
}

export default Nav;
